import logo from './logo.svg';
import './App.css';
import { Route } from 'react-router-dom';
import LogIn from './LogIn/LogIn';

function App() {
  return (
    <div className="App">
     <Route path='/LogIn'> 
        <LogIn />
     </Route>
    </div>
  );
}

export default App;
